import { faClose } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React, { ReactNode, useState } from "react";

export const TwoFACard:React.FC = () => {
    const [code, setCode] = useState<string>();
    return (
        <section className="panel">
            <div className="twofaCard">
                <FontAwesomeIcon icon={faClose} />
                <img src={`https://127.0.0.1:3001/2fa/generate`} alt="qrcode"/>
                <input type="text" className="twofaCode" placeholder="CODE HERE" onChange={(e) => {
                    if (/^[0-9]{6}$/.test(e.target.value))
                        setCode(e.target.value);
                }} value={code}/>
                <button className="confirm">Confirme</button>
            </div>
        </section>
    );
}
